import { Container, FormHelperText, FormLabel } from '@material-ui/core';
import useForm, { FormValues, FormErrors, FormTouched } from '../../customHooks/useForm';
import { yupResolver } from '@hookform/resolvers/yup';
import {  FormCep, Label } from './styles';
import { validationSchema } from './valitation';
import { Controller } from 'react-hook-form';

interface ViaCep {
  bairro: string;
  cep: string;
  complemento: string;
  ddd: string;
