            {errors?.email?.message}
            </FormHelperText>

        <Label>CEP <span>(Obrigatório)</span>:</Label>

        <Controller
            name="cep"
            control={control}
            defaultValue={values.cep || ''}
            render={props => (
             <input
             name="cep"
             placeholder="Cep"
             pattern="[0-9]{5}-[0-9]{3}"
             required
             value={values.cep || userCep?.cep}
                onChange={(e)=>{setData({...data, cep: e.target.value});props.field.onChange(e.target.value)}}
              />
            )}
          />
             <FormHelperText error={Boolean(errors?.cep)}>
            {errors?.cep?.message}
            </FormHelperText>

        <Label>Bairro <span>(Obrigatório)</span>:</Label>

        <Controller
            name="neighborhood"
            control={control}
            defaultValue={values.neighborhood || ''}
            render={props => (
             <input
             name="neighborhood"
             placeholder="Bairro"
             required
             value={userCep?.bairro}
                onChange={(e)=>{setData({...data, neighborhood: e.target.value});props.field.onChange(e.target.value)}}
              />
            )}
          />
             <FormHelperText error={Boolean(errors?.neighborhood)}>
            {errors?.neighborhood?.message}
            </FormHelperText>

      <Label>Cidade <span>(Obrigatório)</span>:</Label>

      <Controller
            name="city"
            control={control}
            defaultValue={values.city || ''}
            render={props => (
             <input
             name="city"
             placeholder="Cidade"
             required
             value={userCep?.localidade}
                onChange={(e)=>{setData({...data, city: e.target.value});props.field.onChange(e.target.value)}}
              />
            )}
          />
             <FormHelperText error={Boolean(errors?.city)}>
            {errors?.city?.message}
            </FormHelperText>

                   <Label>Rua <span>(Obrigatório)</span>:</Label>

                   <Controller
            name="cep"
            control={control}
            defaultValue={values.cep || ''}
            render={props => (
             <input
             name="cep"
             placeholder="Cep"
             pattern="[0-9]{5}-[0-9]{3}"
             required
             value={values.cep || userCep?.cep}
                onChange={(e)=>{setData({...data, cep: e.target.value});props.field.onChange(e.target.value)}}
              />
            )}
          />
             <FormHelperText error={Boolean(errors?.cep)}>
            {errors?.cep?.message}
            </FormHelperText>

